css:
.editor-colors {
  background-color: #eceae8;
  color: #b1a394;
}
.editor {
  background-color: #eceae8;
  color: #b1a394;
}
.editor .wrap-guide {
  background: rgba(245, 250, 255, 0.04);
}
.editor .indent-guide {
  color: rgba(245, 250, 255, 0.04);
}
.editor .invisible-character {
  color: rgba(255, 255, 255, 0.1);
}
.editor .gutter {
  background-color: #e5e1db;
  color: #adaba6;
}
.editor .gutter .line-number {
  background: #e5e1db;
  color: #adaba6;
  padding: 0px;
}
.editor .gutter .line-number.cursor-line {
  background-color: #ded9cd;
  color: #a074c4;
  font-weight: 100;
}
.editor .gutter .line-number.cursor-line-no-selection {
  background-color: #ded9cd !important;
  color: #a074c4;
}
.editor .gutter .line-number:hover {
  background-color: #e5e1db !important;
  color: #a074c4;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #FFF;
  background: #adaba6;
}
.editor .invisible {
  color: rgba(255, 255, 255, 0.1);
}
.editor .cursor {
  border-color: #b1a394 !important;
  border-left: solid 1px;
}
.editor .selection .region {
  background-color: rgba(217, 213, 206, 0.8);
}
.scroll-view {
  padding-left: 10px;
}
.line.cursor-line {
  background: rgba(217, 213, 206, 0.3) !important;
  padding-left: 10px;
  margin-left: -10px;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: solid 1px rgba(0, 0, 0, 0.2);
}
.editor .search-results .marker.current-result .region {
  background-color: rgba(0, 0, 0, 0.6);
  border: solid 1px rgba(0, 0, 0, 0.8);
}
.comment {
  color: #d4c8be;
  background: none;
}
.keyword {
  color: #9fb96e;
}
.keyword.control {
  color: #9fb96e;
}
.keyword.operator {
  color: #9fb96e;
}
.keyword.other.special-method {
  color: #9fb96e;
}
.keyword.other.unit {
  color: #9fb96e;
}
.storage {
  color: #dcb553;
}
.storage.modifier {
  color: #dcb553;
}
.constant {
  color: #a074c4;
}
.constant.character.escape {
  color: #a074c4;
}
.constant.numeric {
  color: #a074c4;
}
.constant.other.color {
  color: #a074c4;
}
.constant.other.symbol {
  color: #a074c4;
}
.variable {
  color: #9fb96e;
}
.variable.interpolation {
  color: #9fb96e;
}
.variable.parameter.function {
  color: #4186ae;
}
.invalid.illegal,
.invalid.deprecated {
  background: none;
  color: #a074c4;
}
.string {
  color: #96c0d8;
}
.string .constant {
  color: #96c0d8;
}
.string.regexp {
  color: #96c0d8;
}
.string.regexp .constant.character.escape,
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #96c0d8;
}
.string.regexp.group {
  color: #96c0d8;
  background-color: #96c0d8;
}
.string.regexp.character-class {
  color: #96c0d8;
}
.string.regexp .source.ruby.embedded {
  color: #96c0d8;
}
.string .variable {
  color: #9fb96e;
}
.string.other.link {
  color: #96c0d8;
}
.source .string .source,
.source .string .meta.embedded.line {
  color: #96c0d8;
}
.source .string .punctuation.section.embedded {
  color: #96c0d8;
}
.source .string .punctuation.section.embedded .source {
  color: #96c0d8;
}
.punctuation.terminator {
  color: #d1c9c0;
}
.punctuation.separator {
  color: #d1c9c0;
}
.punctuation.definition {
  color: #d1c9c0;
}
.punctuation.definition.comment {
  color: #d4c8be;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #96c0d8;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #b1a394;
}
.punctuation.definition.bold {
  color: #b1a394;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #b1a394;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #b1a394;
}
.support {
  color: #a074c4;
}
.support.class {
  color: #a074c4;
}
.support.function {
  color: #a074c4;
}
.support.function.any-method {
  color: #a074c4;
}
.support.constant {
  color: #a074c4;
}
.support.type.property-name.css {
  color: #a074c4;
}
.source .entity.name.tag,
.source .entity.other.attribute-name,
.meta.tag.inline,
.meta.tag.inline .entity {
  color: #96c0d8;
}
.tag,
.tag .entity {
  color: #96c0d8;
}
.html .string {
  color: #b1a394 !important;
}
.html .punctuation.definition.tag {
  color: #dcb553;
}
.html .entity.name.tag {
  text-decoration: done;
}
.html .entity.name.tag.structure {
  color: #dcb553;
}
.html .entity.name.tag.block {
  color: #dcb553;
}
.html .entity.other.attribute-name {
  color: #9fb96e;
}
.entity {
  color: #96c0d8;
}
.entity.name.type {
  color: #96c0d8;
  text-decoration: none;
}
.entity.other.inherited-class {
  color: #96c0d8;
}
.entity.name.function {
  color: #96c0d8;
}
.entity.name.class,
.entity.name.type.class {
  color: #96c0d8;
}
.entity.name.section {
  color: #96c0d8;
}
.entity.name.tag {
  color: #dcb553;
  text-decoration: done;
}
.entity.other.attribute-name {
  color: #9fb96e;
}
.entity.other.attribute-name.id {
  color: #a074c4;
}
.meta .class {
  color: #a074c4;
}
.meta.link {
  color: #b1a394;
}
.meta.require {
  color: #b1a394;
}
.meta.brace.curly {
  color: #d1c9c0;
}
.meta.brace.round {
  color: #b1a394;
}
.meta.comma {
  color: #d1c9c0;
}
.meta.selector {
  color: #d1c9c0;
}
.meta.separator {
  background-color: #d1c9c0;
  color: #d1c9c0;
}
.none {
  color: #b1a394;
}
.markup.bold {
  color: #b1a394;
  font-style: bold;
}
.markup.changed {
  color: #b1a394;
}
.markup.deleted {
  color: #b1a394;
}
.markup.italic {
  color: #b1a394;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #b1a394;
}
.markup.inserted {
  color: #b1a394;
}
.markup.list {
  color: #b1a394;
}
.markup.quote {
  color: #b1a394;
}
.markup.raw.inline {
  color: #b1a394;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b1a394;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
.bracket-matcher {
  border-bottom: 1px solid #96c0d8;
  margin-top: 2px;
}
